import React from 'react';
import { Link } from 'react-router-dom';

import { Container } from './styles';

const Header: React.FC = () => {
    return (
        <Container>

            <nav>
              <h1>
                Dashboard
              </h1>
              <Link to="/dashboard">Dashboard</Link>
            </nav>

        </Container>
      );
    }


export default Header;
